How to run the mongo-kafka connector as a source for kafka and integrate that with logstash input to use elasticsearch as a sink?<p>I have created a build of <a href="https://github.com/mongodb/mongo-kafka" rel="nofollow noreferrer">https://github.com/mongodb/mongo-kafka</a></p>
<p>But how does this run to connect with my running kafka instance.</p>
<p>Even how stupid this question sound. But there is no documentation seems to be available to make this working with locally running <code>replicaset</code> of <code>mongodb</code>.</p>
<p>All blogs point to using mongo atlas instead.</p>
<p>If you have a good resource, please guide me towards it.</p>
<p>UPDATE 1 --</p>
<p>Used maven plugin - <a href="https://search.maven.org/artifact/org.mongodb.kafka/mongo-kafka-connect" rel="nofollow noreferrer">https://search.maven.org/artifact/org.mongodb.kafka/mongo-kafka-connect</a></p>
<p>Placed it in kafka plugins, restarted kafka.</p>
<p>UPDATE 2 -- How to enable mongodb as source for kafka?</p>
<p><a href="https://github.com/mongodb/mongo-kafka/blob/master/config/MongoSourceConnector.properties" rel="nofollow noreferrer">https://github.com/mongodb/mongo-kafka/blob/master/config/MongoSourceConnector.properties</a></p>
<p>file to be used as a configuration for Kafka</p>
<pre><code>bin/kafka-server-start.sh config/server.properties --override config/MongoSourceConnector.properties
</code></pre>
<p>UPDATE 3 - The above method hasn't worked going back to the <a href="https://www.mongodb.com/blog/post/getting-started-with-the-mongodb-connector-for-apache-kafka-and-mongodb-atlas" rel="nofollow noreferrer">blog</a> which does not mention what the port 8083 is.</p>
<p>Installed Confluent and confluent-hub, still unsure of the mongo-connector working with kafka.</p>
<p>UPDATE 4 -</p>
<p>Zookeeper, Kafka Server, Kafka connect running</p>
<p><a href="https://search.maven.org/artifact/org.mongodb.kafka/mongo-kafka-connect/1.3.0/jar" rel="nofollow noreferrer">Mongo Kafka Library Files</a>
<a href="https://www.confluent.io/hub/confluentinc/kafka-connect-avro-converter" rel="nofollow noreferrer">Kafka Connect Avro Connector Library Files</a></p>
<p>Using below commands my source got working -</p>
<pre><code>bin/zookeeper-server-start.sh config/zookeeper.properties
bin/kafka-server-start.sh config/server.properties
bin/connect-standalone.sh config/connect-standalone.properties config/MongoSourceConnector.properties
</code></pre>
<p>And using below configuration for logstash I was able to push data into elasticsearch -</p>
<pre><code>input {
  kafka {
        bootstrap_servers =&gt; &quot;localhost:9092&quot;
        topics =&gt; [&quot;users&quot;,&quot;organisations&quot;,&quot;skills&quot;]
  }
}
output {
  elasticsearch {
        hosts =&gt; [&quot;localhost:9200&quot;]
  }
  stdout { codec =&gt; rubydebug }
}
</code></pre>
<p>So now one MongoSourceConnector.properties keeps a single collection name it reads from, I need to run kafka connect with different property files for each collection.</p>
<p>My Logstash is pushing new data into elasticsearch, instead of updating old data. Plus it is not creating indexes as per the name of the collection. The idea is this should be able to sync with my MongoDB Database perfectly.</p>
<p>FINAL UPDATE - Everything is now working smoothly,</p>
<ul>
<li>Created multiple properties files for kafka connect</li>
<li>The latest logstash actually creates index as per the topic name, and updates the indexes accordingly</li>
</ul>
<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-html lang-html prettyprint-override"><code>input {
    kafka {
        bootstrap_servers =&gt; "localhost:9092"
        decorate_events =&gt; true
        topics =&gt; ["users","organisations","skills"]
    }
}
filter {
    json {
        source =&gt; "message"
        target =&gt; "json_payload"
    }

    json {
        source =&gt; "[json_payload][payload]"
        target =&gt; "payload"
    }

    mutate {
        add_field =&gt; { "[es_index]" =&gt; "%{[@metadata][kafka][topic]}" }
        rename =&gt; { "[payload][fullDocument][_id][$oid]" =&gt; "mongo_id"}
        rename =&gt; { "[payload][fullDocument]" =&gt; "document"}
        remove_field =&gt; ["message","json_payload","payload"]
    }
}
output {
    elasticsearch {
        hosts =&gt; ["localhost:9200"]
        index =&gt; "%{es_index}"
        action =&gt; "update"
        doc_as_upsert =&gt; true
        document_id =&gt; "%{mongo_id}"
    }
    stdout {
        codec =&gt;
        rubydebug {
            metadata =&gt; true
        }
    }
}</code></pre>
</div>
</div>
</p>

