Issue with AccumulatorOperators Max when creating aggregation pipeline<p>I'm trying to convert following Mongo shell aggregation query into Spring Data MongoDB Aggregation:</p>
<pre><code>db.getCollection('Orders').aggregate([
{ $group: {
    &quot;_id&quot;: {&quot;book&quot;:&quot;$bookingId&quot;},
    &quot;docs&quot;: {$push: '$$ROOT'}
  }
},
{$project: {
   latestOrd: {
      $filter: {
         input: &quot;$docs&quot;,
         as: &quot;item&quot;,
         cond: { $eq: [&quot;$$item.bookingVersion&quot;, { $max: &quot;$docs.bookingVersion&quot; }] }
      }
   }
 }
},
{ $unwind: &quot;$latestOrd&quot; },
{ $replaceRoot:{newRoot:&quot;$latestOrd&quot;}}
])
</code></pre>
<p>Query fetches all orders with highest booking version (for example one bookingId may have many documents with version 3).</p>
<p>This query works fine in Mongo shell but I have issue with Spring Data version of it:</p>
