Merge parent field and its nested array field in mongodb<p>I have a collection like below</p>
<pre><code>{
    &quot;id&quot;:&quot;5fd13c33ac0277c435117519&quot;,
    &quot;content&quot;:&quot;test&quot;,
    &quot;votes&quot;:[
        {
            &quot;user&quot;:&quot;22&quot;,
            &quot;isLike&quot;:true
        },
        {
            &quot;user&quot;:&quot;25&quot;,
            &quot;isLike&quot;:false
        },
        {
            &quot;user&quot;:&quot;43&quot;,
            &quot;isLike&quot;:false
        }
    ]
},
{
    &quot;id&quot;:&quot;5fd13c33ac0277c435237443&quot;,
    &quot;content&quot;:&quot;test 2&quot;,
    &quot;votes&quot;:[
        {
            &quot;user&quot;:&quot;25&quot;,
            &quot;isLike&quot;:true
        },
        {
            &quot;user&quot;:&quot;43&quot;,
            &quot;isLike&quot;:false
        }
    ]
}
</code></pre>
<p>How can I get the result below with c# driver by querying over votes.user -ie. 25- and then merge those 2 fields from parent and nested array?</p>
